import formatDate from "../../util/formatDate";

const tableData = (typeData, data) => {
  console.log(typeData);
  console.log(data);
  switch (typeData) {
    case "phoneNo":
      return "+" + data[typeData];
    case "createdDate":
      return formatDate(data, "UTC");
    case "updatedDate":
      return formatDate(data, "UTC");
    case "action":
      return (
        <a href={`/clients/${5}`}>
          {" "}
          <i className="fas fa-ellipsis-h" />
        </a>
      );
    default:
      return "data";
  }
};

export default tableData;
